import{createInstance}from"../../keyword/create-instance.min.js";import{Buildable}from"../../interface/buildable.min.js";import{DeviceHelpModel}from"../../model/help/device-help-model.min.js";import{Threading}from"../../shared/utility/threading.min.js";import{PageColorAdjuster}from"../../shared/page-color-adjuster.min.js";import ScriptSeriesLoader from"../../shared/script-series-loader.min.js";import StylesheetSeriesLoader from"../../shared/stylesheet-series-loader.min.js";class DeviceHelpController extends Buildable{constructor(){super(),this.model=new DeviceHelpModel,this.stylesheetLoader=StylesheetSeriesLoader,this.stylesheetLoader.add("css/work-experience.min.css"),this.stylesheetLoader.load(),this.scriptLoader=ScriptSeriesLoader,this.scriptLoader.add("https://ajax.googleapis.com/ajax/libs/jquery/3.3.1/jquery.min.js","jQuery"),this.scriptLoader.load()}static build=async()=>{const e=new DeviceHelpController;for(;e.scriptLoader.running;)await Threading.sleep(2e3);return e};execute=async()=>{const e=this.model.getDevices();for(let t=0;t<e.length;t++){const r=e[t],s=[];s.push(this.createNoTd(t)),s.push(this.createNameTd(r)),s.push(this.createDescriptionTd(r));const i=`<tr>${s.join("")}</tr>`;$("#help-info tr:last").after(i)}(await createInstance(PageColorAdjuster)).changeBackgroundColor(),$("body").addClass("loaded")};createTd=e=>`<td class='help-info-cell'>${e}</td>`;createNoTd=e=>{const t=e+1;return this.createTd(`<p style='text-align:center;'>${t}</p>`)};createNameTd=e=>this.createTd(`<p class="work-experience-technology-device" style="white-space:nowrap;">${e.name}</p>`);createDescriptionTd=e=>this.createTd(`<p>${e.description}</p>`)}export{DeviceHelpController};